import React, { useState } from 'react';
import logo from '../../assets/images/logo.png'; 

const CreateSpace = () => {
  const [spaceData, setSpaceData] = useState({
    image: '',
    name: '',
    location: '',
    capacity: '',
    amenities: '',
    rateCard: ''
  });
  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSpaceData({
      ...spaceData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you can perform any additional actions, such as sending data to a server
    setSubmitted(true);
    console.log(spaceData);
    // Reset form
    setSpaceData({
      image: '',
      name: '',
      location: '',
      capacity: '',
      amenities: '',
      rateCard: ''
    });
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
      {/* Navigation Bar */}
      <header className='w-full p-4 flex justify-between items-center bg-white shadow-md'>
        <a href="/" className='flex items-center space-x-2'>
          <img src={logo} alt="Space Hub Logo" className="w-20 h-18" />
        </a>
        <nav className='flex space-x-4'>
          <a href="/" className='hover:text-yellow-400'>Home</a>
        </nav>
      </header>

      <h2 className="text-2xl font-bold my-6">Create a New Space</h2>
      {!submitted ? (
        <form onSubmit={handleSubmit} className="bg-white p-8 rounded shadow-md w-full max-w-lg">
          <div className="mb-4">
            <label htmlFor="image" className="block text-gray-700 text-sm font-bold mb-2">
              Image URL
            </label>
            <input
              type="text"
              id="image"
              name="image"
              value={spaceData.image}
              onChange={handleChange}
              placeholder="Enter image URL"
              className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
            />
          </div>
          <div className="mb-4">
            <label htmlFor="name" className="block text-gray-700 text-sm font-bold mb-2">
              Name/Location
            </label>
            <input
              type="text"
              id="name"
              name="name"
              value={spaceData.name}
              onChange={handleChange}
              placeholder="Enter name or location"
              className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
            />
          </div>
          <div className="mb-4">
            <label htmlFor="capacity" className="block text-gray-700 text-sm font-bold mb-2">
              Capacity
            </label>
            <input
              type="number"
              id="capacity"
              name="capacity"
              value={spaceData.capacity}
              onChange={handleChange}
              placeholder="Enter capacity"
              className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
            />
          </div>
          <div className="mb-4">
            <label htmlFor="amenities" className="block text-gray-700 text-sm font-bold mb-2">
              Amenities
            </label>
            <textarea
              id="amenities"
              name="amenities"
              value={spaceData.amenities}
              onChange={handleChange}
              placeholder="Enter amenities (comma separated)"
              className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
            ></textarea>
          </div>
          <div className="mb-4">
            <label htmlFor="rateCard" className="block text-gray-700 text-sm font-bold mb-2">
              Rate Card (per hour)
            </label>
            <input
              type="text"
              id="rateCard"
              name="rateCard"
              value={spaceData.rateCard}
              onChange={handleChange}
              placeholder="Enter rate card"
              className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
            />
          </div>
          <button
            type="submit"
            className="w-full bg-indigo-500 hover:bg-indigo-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Create Space
          </button>
        </form>
      ) : (
        <div className="text-center bg-white p-8 rounded shadow-md w-full max-w-lg">
          <p className="text-lg font-bold">Space created successfully!</p>
        </div>
      )}
    </div>
  );
};

export default CreateSpace;
